for(let e=0;e<5;e++)console.log("%ctikzjax-node.js loaded","font-weight: bold;");const TIKZJAX_FIX_CONFIG={TIMEOUT_MS:3e3,CONTAINER_SELECTORS:[".tikzjax-node"]};function processTikzNodes(){const e=document.querySelectorAll(TIKZJAX_FIX_CONFIG.CONTAINER_SELECTORS.join(","));e.forEach(e=>{const t=e.querySelectorAll("svg");t.forEach(e=>{const t=Array.from(e.querySelectorAll("path")).filter(e=>{const t=e.getAttribute("d")||"";return t.includes("M")&&t.includes("Z")});t.forEach(t=>{t.getAttribute("fill")==="none"&&t.removeAttribute("fill");let n=t.parentElement;for(;n&&n!==e;)n.getAttribute("fill")==="none"&&n.removeAttribute("fill"),n=n.parentElement})})})}document.addEventListener("DOMContentLoaded",function(){setTimeout(processTikzNodes,TIKZJAX_FIX_CONFIG.TIMEOUT_MS)})